import React, { Component } from 'react';
import {Row, Col} from 'reactstrap';
import './header.css';

export default class Header extends Component {
    render() {
        
      return ( 
<div class="head">
    <Row>
        <Col lg={6} sm={6} xs={6}>
        <button onClick={() => <WidgetsHandler/>}>
        WIDGETS
      </button>
        
        </Col>
        <Col lg={6} sm={6} xs={6}>
        <button onClick={() => console.log(`Bonsoir`)}>
        DATA FORMS
      </button>
        </Col>
    </Row>
</div>
     );
    }
  }
